// src/components/PropertyForm.js
import React, { useState } from 'react';
import axios from 'axios';
import './PropertyForm.css';

// Ïã§Ï†ú Î∞±ÏóîÎìú Ï£ºÏÜå(ngrok Îì±)Î°ú ÍµêÏ≤¥ÌïòÏÑ∏Ïöî.
//const API_URL = 'https://2094-165-229-229-106.ngrok-free.app';
const API_URL = 'http://localhost:8080'; // Î°úÏª¨ Í∞úÎ∞úÏö©

export default function PropertyForm({ user, onRegister }) {
  // 1) Îß§Î¨º Ï†ïÎ≥¥: Ï£ºÏÜå ¬∑ ÏÜåÏú†Ïûê ¬∑ Í∞ÄÍ≤©
  const [form, setForm] = useState({
    address: '',
    owner: '',
    price: ''
  });

  // 2) ÏÑ†ÌÉùÎêú ÏÇ¨ÏßÑ ÌååÏùº
  const [photoFile, setPhotoFile] = useState(null);

  // 3) ÏóÖÎ°úÎìú Ï§ë ÌëúÏãú
  const [uploading, setUploading] = useState(false);

  // ÏûÖÎ†•Í∞í Ìï∏Îì§Îü¨
  const handleChange = e => {
    const { name, value } = e.target;
    setForm(prev => ({ ...prev, [name]: value }));
  };

  // ÌååÏùº ÏÑ†ÌÉù Ìï∏Îì§Îü¨
  const handleFileChange = e => {
    if (e.target.files && e.target.files[0]) {
      setPhotoFile(e.target.files[0]);
    }
  };

  // Ìèº Ï†úÏ∂ú
  const handleSubmit = async e => {
    e.preventDefault();

    // Ïú†Ìö®ÏÑ± Í≤ÄÏÇ¨
    if (!form.address.trim() || !form.owner.trim() || !form.price) {
      alert('‚ùó Ï£ºÏÜå, ÏÜåÏú†Ïûê, Í∞ÄÍ≤©ÏùÑ Î™®Îëê ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.');
      return;
    }

    setUploading(true);

    try {
      let finalPhotoUrl = '';

      // 1Îã®Í≥Ñ: ÏÇ¨ÏßÑ ÏóÖÎ°úÎìú (photoFileÏù¥ ÏûàÏùÑ ÎïåÎßå)
      if (photoFile) {
        console.log('üëâ 1Îã®Í≥Ñ: ÏÇ¨ÏßÑ ÏóÖÎ°úÎìú ÏãúÏûë');

        // **Ï§ëÏöî: Î∞±ÏóîÎìúÎäî `photo`ÎùºÎäî ÌïÑÎìúÎ™Ö(FormFile("photo"))ÏúºÎ°ú Í∞ÄÏ†∏Í∞ëÎãàÎã§.**
        const photoData = new FormData();
        photoData.append('photo', photoFile);
        // ^^^ Ïó¨Í∏∞ keyÎ•º "photo"Î°ú Î∞òÎìúÏãú ÎßûÏ∂∞Ïïº Ìï©ÎãàÎã§.

        const photoRes = await axios.post(
          `${API_URL}/upload-photo`,
          photoData,
          {
            headers: {
              'Content-Type': 'multipart/form-data'
              // ngrok Í≤ΩÍ≥†Í∞Ä ÌïÑÏöîÌïòÎ©¥ Ïó¨Í∏∞Ïóê Ï∂îÍ∞Ä: 'ngrok-skip-browser-warning': 'true'
            }
          }
        );

        // Î∞±ÏóîÎìúÏóêÏÑú { "photoUrl": "http://localhost:8080/uploads/ÌååÏùºÎ™Ö.jpg" } ÌòïÌÉúÎ°ú ÎÇ¥Î†§Ï§ÄÎã§Í≥† Í∞ÄÏ†ï
        finalPhotoUrl = photoRes.data.photoUrl;
        console.log('‚úÖ ÏÇ¨ÏßÑ ÏóÖÎ°úÎìú ÏÑ±Í≥µ, photoUrl:', finalPhotoUrl);
      }

      // 2Îã®Í≥Ñ: Îß§Î¨º Îì±Î°ù
      console.log('üëâ 2Îã®Í≥Ñ: Îß§Î¨º Îì±Î°ù ÏãúÏûë');
      console.log('   payload ‚Üí', {
        user: user?.username || user?.id,
        address: form.address,
        owner: form.owner,
        price: form.price,
        photoUrl: finalPhotoUrl
      });

      const addRes = await axios.post(
        `${API_URL}/add-property`,
        {
          user: user?.username,     // ‚Üê Ïó¨Í∏∞Î•º Íº≠ Ï∂îÍ∞Ä!
          address: form.address,
          owner: form.owner,
          price: form.price,
          photoUrl: finalPhotoUrl
        },
        {
          headers: {
            'Content-Type': 'application/json'
          }
        }
      );

      console.log('‚úÖ Îß§Î¨º Îì±Î°ù ÏÑ±Í≥µ:', addRes.data);
      alert('üè† Îß§Î¨ºÏù¥ ÏÑ±Í≥µÏ†ÅÏúºÎ°ú Îì±Î°ùÎêòÏóàÏäµÎãàÎã§.');

      // ÏûÖÎ†• Ï¥àÍ∏∞Ìôî
      setForm({ address: '', owner: '', price: '' });
      setPhotoFile(null);

      // Î∂ÄÎ™®ÏóêÍ≤å Îì±Î°ù ÏôÑÎ£å ÏïåÎ¶¨Í≥† Î™©Î°ù ÏÉàÎ°úÍ≥†Ïπ® ÏöîÏ≤≠
      onRegister();
    } catch (err) {
      console.error('‚ùå Îß§Î¨º Îì±Î°ù Ïò§Î•ò:', err.response?.data || err.message);
      alert(
        '‚ö†Ô∏è Îì±Î°ù Ï§ë Ïò§Î•òÍ∞Ä Î∞úÏÉùÌñàÏäµÎãàÎã§.\n' +
        (err.response?.data?.error || err.response?.data?.detail || err.message)
      );
    } finally {
      setUploading(false);
    }
  };

  return (
    <form onSubmit={handleSubmit} className="property-form">
      <div className="form-group">
        <label>Ï£ºÏÜå</label>
        <input
          name="address"
          type="text"
          placeholder="Ïòà) ÏÑúÏö∏ÌäπÎ≥ÑÏãú Í∞ïÎÇ®Íµ¨ ÌÖåÌó§ÎûÄÎ°ú 123"
          value={form.address}
          onChange={handleChange}
          required
        />
      </div>

      <div className="form-group">
        <label>ÏÜåÏú†Ïûê</label>
        <input
          name="owner"
          type="text"
          placeholder="Ïòà) ÌôçÍ∏∏Îèô"
          value={form.owner}
          onChange={handleChange}
          required
        />
      </div>

      <div className="form-group">
        <label>Í∞ÄÍ≤© (Ïõê)</label>
        <input
          name="price"
          type="number"
          placeholder="Ïòà) 500000000"
          value={form.price}
          onChange={handleChange}
          required
        />
      </div>

      <div className="form-group">
        <label>Îß§Î¨º ÏÇ¨ÏßÑ (ÏÑ†ÌÉù)</label>
        {/* ÌååÏùº ÏóÖÎ°úÎìúÏö© input: accept Ïù¥ÎØ∏ÏßÄ Ìè¨Îß∑ */}
        <input
          type="file"
          accept="image/*"
          onChange={handleFileChange}
        />
      </div>

      <button
        type="submit"
        className="btn-submit"
        disabled={uploading}
      >
        {uploading ? 'Îì±Î°ù Ï§ë‚Ä¶' : 'Îß§Î¨º Îì±Î°ù'}
      </button>
    </form>
  );
}
